// Header.js
import React from 'react';
import { Header as HeaderRNE } from '@rneui/themed';

const Header = ({ title }) => {
  return (
    <HeaderRNE
      leftComponent={{
        icon: 'menu',
        color: '#fff',
      }}      
      centerComponent={{ text: title, style: { color: 'white', fontSize: 22, fontWeight: 'bold' } }}
    />
  );
};

export default Header;
